import React from 'react';
import "./website.css";
import Navbar from "./Navbar";
import {Routes,Route} from "react-router-dom";

function Website() {
  return (
    <>
 <Routes>
    <Route path="/" element={<Navbar/>}/>
 </Routes>
  
   </>
  )
}

export default Website;
